import React, { use } from 'react';
import { Chart } from "react-google-charts";
import Highcharts from 'highcharts';
import HighchartsReact from 'highcharts-react-official';
import 'gridstack/dist/gridstack.min.css';
import './App.css';
import './litegride.css';
import { GridStack } from 'gridstack';
import Tema from './assets/img/tema.jpg';
function MyComponent() {
  const gridRef = useRef(null);
  const chartRef = useRef(null);

  useEffect(() => {
    const options = {
      draggable: {
        handle: '.dragbox-header',
        scroll: false,
        appendTo: 'body',
      },
      placeholderClass: 'placeholder',
      acceptWidgets: true,
      cellHeight: 60,
    };
    const grid = GridStack.init(options, gridRef.current);

    const chart = Highcharts.chart(chartRef.current, {
      chart: {
        animation: false,
        type: 'bar',
      },
      plotOptions: {
        series: {
          animation: false,
        },
      },
      title: {
        text: 'Fruit Consumption',
      },
      xAxis: {
        categories: ['Apples', 'Bananas', 'Oranges'],
      },
      yAxis: {
        title: {
          text: 'Fruit eaten',
        },
      },
      series: [
        {
          name: 'Jane',
          data: [1, 0, 4],
        },
        {
          name: 'John',
          data: [5, 7, 3],
        },
      ],
    });

    grid.on('change', (event, items) => {
      const chartContainer = chart.renderTo;
      const chartHeader = document.querySelector('#testChartHeader');
      const chartHeight =
        chartContainer.parentElement.clientHeight - chartHeader.clientHeight;

      chartContainer.style.height = `${chartHeight}px`;
      chart.reflow();
    });
  }, []);

  return (
    <div>
      <div className="grid-stack" ref={gridRef}>
        {/* elementos do seu gridstack */}
      </div>
      <div id="testChart">
        <div id="testChartHeader">
          {/* elemento do cabeçalho do gráfico */}
        </div>
        <div ref={chartRef}>
          {/* elemento onde o gráfico será renderizado */}
        </div>
      </div>
    </div>
  );
} export default App;


